const HotelJson=[
  {
    "element" : "input",
    "type" : "text",
    "id" : "room",
    "name" : "room",
    "placeholder" : "Rooms"
  },
  {
    "element" : "input",
    "type" : "text",
    "id" : "to",
    "name" : "to",
    "placeholder" : "Going to"
  },
  {
    "element" : "input",
    "type" : "date",
    "id" : "checkin",
    "name" : "checkin"
  },
  {
    "element" : "label",
    "text" : <i className="fas fa-long-arrow-alt-right"></i>,
    "id" : "arrowto"
  },
  {
    "element" : "input",
    "type" : "date",
    "id" : "checkout",
    "name" : "checkout"
  },
  {
    "element" : "input",
    "type" : "submit",
    "id" : "search",
    "value" : "search"
  }
]
export default HotelJson;
